    return (
        <>
            <h1>Welcome to site created by D</h1>
            <h1>This site illustates Google auth login</h1>
            <button onClick={() => loginWithRedirect()}>Log In</button>;
            <Routes>
                <Route path='/login' exact element={<Login />} />
            </Routes>
        </>
    )
}

